{"query":"# Updates the attributes on a cart.
mutation (attributes: $attributes,cartId: $cartId) {
		cart
		userErrors
	} 
}","variables":"{"attributes":"","cartId":""}"}

{"query":"# Updates customer information associated with a cart.
# Buyer identity is used to determine
# [international pricing](https://shopify.dev/custom-storefronts/internationalization/international-pricing)
# and should match the customer's shipping address.
# 
mutation (cartId: $cartId,buyerIdentity: $buyerIdentity) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","buyerIdentity":""}"}

{"query":"# Creates a new cart.
mutation (input: $input) {
		cart
		userErrors
	} 
}","variables":"{"input":{"attributes":"","lines":"","discountCodes":"","note":"","buyerIdentity":{"email":"","phone":"","countryCode":"","customerAccessToken":"","deliveryAddressPreferences":""}}}"}

{"query":"# Updates the discount codes applied to the cart.
mutation (cartId: $cartId,discountCodes: $discountCodes) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","discountCodes":""}"}

{"query":"# Adds a merchandise line to the cart.
mutation (lines: $lines,cartId: $cartId) {
		cart
		userErrors
	} 
}","variables":"{"lines":"","cartId":""}"}

{"query":"# Removes one or more merchandise lines from the cart.
mutation (cartId: $cartId,lineIds: $lineIds) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","lineIds":""}"}

{"query":"# Updates one or more merchandise lines on a cart.
mutation (cartId: $cartId,lines: $lines) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","lines":""}"}

{"query":"# Updates the note on the cart.
mutation (cartId: $cartId,note: $note) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","note":""}"}

{"query":"# Update the selected delivery options for a delivery group.
mutation (cartId: $cartId,selectedDeliveryOptions: $selectedDeliveryOptions) {
		cart
		userErrors
	} 
}","variables":"{"cartId":"","selectedDeliveryOptions":""}"}

{"query":"# Updates the attributes of a checkout if `allowPartialAddresses` is `true`.
mutation (checkoutId: $checkoutId,input: $input) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":"","input":""}"}

{"query":"# Completes a checkout without providing payment information. You can use this mutation for free items or items whose purchase price is covered by a gift card.
mutation (checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":""}"}

{"query":"# Completes a checkout using a credit card token from Shopify's card vault. Before you can complete checkouts using CheckoutCompleteWithCreditCardV2, you need to  [_request payment processing_](https://shopify.dev/apps/channels/getting-started#request-payment-processing).
mutation (checkoutId: $checkoutId,payment: $payment) {
		checkout
		checkoutUserErrors
		payment
		userErrors
	} 
}","variables":"{"checkoutId":"","payment":""}"}

{"query":"# Completes a checkout with a tokenized payment.
mutation (checkoutId: $checkoutId,payment: $payment) {
		checkout
		checkoutUserErrors
		payment
		userErrors
	} 
}","variables":"{"checkoutId":"","payment":""}"}

{"query":"# Creates a new checkout.
mutation (input: $input,queueToken: $queueToken) {
		checkout
		checkoutUserErrors
		queueToken
		userErrors
	} 
}","variables":"{"input":"","queueToken":""}"}

{"query":"# Associates a customer to the checkout.
mutation (checkoutId: $checkoutId,customerAccessToken: $customerAccessToken) {
		checkout
		checkoutUserErrors
		customer
		userErrors
	} 
}","variables":"{"checkoutId":"","customerAccessToken":""}"}

{"query":"# Disassociates the current checkout customer from the checkout.
mutation (checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":""}"}

{"query":"# Applies a discount to an existing checkout using a discount code.
mutation (discountCode: $discountCode,checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"discountCode":"","checkoutId":""}"}

{"query":"# Removes the applied discounts from an existing checkout.
mutation (checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":""}"}

{"query":"# Updates the email on an existing checkout.
mutation (checkoutId: $checkoutId,email: $email) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":"","email":""}"}

{"query":"# Removes an applied gift card from the checkout.
mutation (appliedGiftCardId: $appliedGiftCardId,checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"appliedGiftCardId":"","checkoutId":""}"}

{"query":"# Appends gift cards to an existing checkout.
mutation (giftCardCodes: $giftCardCodes,checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"giftCardCodes":"","checkoutId":""}"}

{"query":"# Adds a list of line items to a checkout.
mutation (lineItems: $lineItems,checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"lineItems":"","checkoutId":""}"}

{"query":"# Removes line items from an existing checkout.
mutation (checkoutId: $checkoutId,lineItemIds: $lineItemIds) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":"","lineItemIds":""}"}

{"query":"# Sets a list of line items to a checkout.
mutation (lineItems: $lineItems,checkoutId: $checkoutId) {
		checkout
		userErrors
	} 
}","variables":"{"lineItems":"","checkoutId":""}"}

{"query":"# Updates line items on a checkout.
mutation (checkoutId: $checkoutId,lineItems: $lineItems) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":"","lineItems":""}"}

{"query":"# Updates the shipping address of an existing checkout.
mutation (shippingAddress: $shippingAddress,checkoutId: $checkoutId) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"shippingAddress":"","checkoutId":""}"}

{"query":"# Updates the shipping lines on an existing checkout.
mutation (checkoutId: $checkoutId,shippingRateHandle: $shippingRateHandle) {
		checkout
		checkoutUserErrors
		userErrors
	} 
}","variables":"{"checkoutId":"","shippingRateHandle":""}"}

{"query":"# Creates a customer access token.
# The customer access token is required to modify the customer object in any way.
# 
mutation (input: $input) {
		customerAccessToken
		customerUserErrors
		userErrors
	} 
}","variables":"{"input":""}"}

{"query":"# Creates a customer access token using a
# [multipass token](https://shopify.dev/api/multipass) instead of email and
# password. A customer record is created if the customer doesn't exist. If a customer
# record already exists but the record is disabled, then the customer record is enabled.
# 
mutation (multipassToken: $multipassToken) {
		customerAccessToken
		customerUserErrors
	} 
}","variables":"{"multipassToken":""}"}

{"query":"# Permanently destroys a customer access token.
mutation (customerAccessToken: $customerAccessToken) {
		deletedAccessToken
		deletedCustomerAccessTokenId
		userErrors
	} 
}","variables":"{"customerAccessToken":""}"}

{"query":"# Renews a customer access token.
# 
# Access token renewal must happen *before* a token expires.
# If a token has already expired, a new one should be created instead via `customerAccessTokenCreate`.
# 
mutation (customerAccessToken: $customerAccessToken) {
		customerAccessToken
		userErrors
	} 
}","variables":"{"customerAccessToken":""}"}

{"query":"# Activates a customer.
mutation (id: $id,input: $input) {
		customer
		customerAccessToken
		customerUserErrors
		userErrors
	} 
}","variables":"{"id":"","input":""}"}

{"query":"# Activates a customer with the activation url received from `customerCreate`.
mutation (activationUrl: $activationUrl,password: $password) {
		customer
		customerAccessToken
		customerUserErrors
	} 
}","variables":"{"activationUrl":"","password":""}"}

{"query":"# Creates a new address for a customer.
mutation (customerAccessToken: $customerAccessToken,address: $address) {
		customerAddress
		customerUserErrors
		userErrors
	} 
}","variables":"{"customerAccessToken":"","address":""}"}

{"query":"# Permanently deletes the address of an existing customer.
mutation (id: $id,customerAccessToken: $customerAccessToken) {
		customerUserErrors
		deletedCustomerAddressId
		userErrors
	} 
}","variables":"{"id":"","customerAccessToken":""}"}

{"query":"# Updates the address of an existing customer.
mutation (customerAccessToken: $customerAccessToken,id: $id,address: $address) {
		customerAddress
		customerUserErrors
		userErrors
	} 
}","variables":"{"customerAccessToken":"","id":"","address":""}"}

{"query":"# Creates a new customer.
mutation (input: $input) {
		customer
		customerUserErrors
		userErrors
	} 
}","variables":"{"input":""}"}

{"query":"# Updates the default address of an existing customer.
mutation (customerAccessToken: $customerAccessToken,addressId: $addressId) {
		customer
		customerUserErrors
		userErrors
	} 
}","variables":"{"customerAccessToken":"","addressId":""}"}

{"query":"# "Resets a customer’s password with the token received from a reset password email. You can send a reset password email with the [`customerRecover`](https://shopify.dev/api/storefront/latest/mutations/customerRecover) mutation."
# 
mutation (id: $id,input: $input) {
		customer
		customerAccessToken
		customerUserErrors
		userErrors
	} 
}","variables":"{"id":"","input":""}"}

{"query":"# "Resets a customer’s password with the reset password URL received from a reset password email. You can send a reset password email with the [`customerRecover`](https://shopify.dev/api/storefront/latest/mutations/customerRecover) mutation."
# 
mutation (resetUrl: $resetUrl,password: $password) {
		customer
		customerAccessToken
		customerUserErrors
		userErrors
	} 
}","variables":"{"resetUrl":"","password":""}"}

{"query":"# Updates an existing customer.
mutation (customerAccessToken: $customerAccessToken,customer: $customer) {
		customer
		customerAccessToken
		customerUserErrors
		userErrors
	} 
}","variables":"{"customerAccessToken":"","customer":""}"}

{"query":"# List of the shop's blogs.
query (first: $first,after: $after,last: $last,before: $before,reverse: $reverse,sortKey: $sortKey,query: $query) {
		edges { nodes { 		articleByHandle
		articles
		authors
		handle
		id
		metafield
		metafields
		onlineStoreUrl
		seo
		title}
}
		nodes
		pageInfo
	} 
}","variables":"{"first":"","after":"","last":"","before":"","reverse":"","sortKey":"","query":""}"}

{"query":"# List of the shop’s collections.
query (first: $first,after: $after,last: $last,before: $before,reverse: $reverse,sortKey: $sortKey,query: $query) {
		edges { nodes { 		description
		descriptionHtml
		handle
		id
		image
		metafield
		metafields
		onlineStoreUrl
		products
		seo
		title
		updatedAt}
}
		nodes
		pageInfo
	} 
}","variables":"{"first":"","after":"","last":"","before":"","reverse":"","sortKey":"","query":""}"}

{"query":"# Returns the localized experiences configured for the shop.
query  {
		availableCountries
		availableLanguages
		country
		language
	} 
}","variables":"{}"}

{"query":"# List of the shop's locations that support in-store pickup.
# 
# When sorting by distance, you must specify a location via the `near` argument.
# 
query (first: $first,after: $after,last: $last,before: $before,reverse: $reverse,sortKey: $sortKey,near: $near) {
		edges { nodes { 		address
		id
		name}
}
		nodes
		pageInfo
	} 
}","variables":"{"first":"","after":"","last":"","before":"","reverse":"","sortKey":"","near":{"latitude":"","longitude":""}}"}

{"query":"# A storefront menu.
query (handle: $handle) {
		handle
		id
		items
		itemsCount
		title
	} 
}","variables":"{"handle":""}"}

{"query":"# Fetch a specific Metaobject by one of its unique identifiers.
query (id: $id,handle: $handle) {
		field
		fields
		handle
		id
		type
		updatedAt
	} 
}","variables":"{"id":"","handle":{"handle":"","type":""}}"}

{"query":"# All active metaobjects for the shop.
query (type: $type,sortKey: $sortKey,first: $first,after: $after,last: $last,before: $before,reverse: $reverse) {
		edges { nodes { 		field
		fields
		handle
		id
		type
		updatedAt}
}
		nodes
		pageInfo
	} 
}","variables":"{"type":"","sortKey":"","first":"","after":"","last":"","before":"","reverse":""}"}

{"query":"# Returns a specific node by ID.
query (id: $id) {
		id
	} 
}","variables":"{"id":""}"}

{"query":"# Returns the list of nodes with the given IDs.
query (ids: $ids) {

	} 
}","variables":"{"ids":""}"}

{"query":"# List of the shop's pages.
query (first: $first,after: $after,last: $last,before: $before,reverse: $reverse,sortKey: $sortKey,query: $query) {
		edges { nodes { 		body
		bodySummary
		createdAt
		handle
		id
		metafield
		metafields
		onlineStoreUrl
		seo
		title
		updatedAt}
}
		nodes
		pageInfo
	} 
}","variables":"{"first":"","after":"","last":"","before":"","reverse":"","sortKey":"","query":""}"}

